import React from 'react';
import { Field, reduxForm } from 'redux-form';


const Login = () => {
    return (
        <>
            <Form>
                <Field
                    name="email"
                    label="Email*"
                    type="email"
                    placeholder="Email"
                    component={this.renderField}
                />
                <Field
                    name="password"
                    label="Heslo*"
                    type="password"
                    placeholder="Heslo"
                    component={this.renderField}
                />
                <Button color="primary">Login</Button>
            </Form>
        </>
    )
}

export default Login
